import React from 'react';
import { MdSearch } from 'react-icons/md';

import { Container } from './styles';

export default function Encomendas() {
  return (
    <Container>
      <h2>Gerenciando Encomendas</h2>
      <input>
        <MdSearch size={20} />
      </input>
    </Container>
  );
}
